import {connect} from "react-redux";
import {withRouter} from "react-router-dom"
import {compose} from "redux";
import NewSnekOrder from "./NewSnekOrder";
import {newItem} from "../../../Redux/later-seen-reducer";


class NewSnekOrderContainer extends React.Component {


    render() {
        this.props.newItem(this.props.snek[this.props.match.params.id - 45])

        return (
            <NewSnekOrder snek={this.props.snek} number={this.props.match.params.id - 45}/>
        )
    }
}


let mapStateToprops = (state) => {

    return {
        snek: state.newSnekPage.snek,


    }


}

export default compose(
    connect(mapStateToprops, {newItem}),
    withRouter,
)(NewSnekOrderContainer)
